const getVendorStore = asyncHandler(async (req, res) => {
  if (!req.vendor) {
    res.status(401);
    throw new Error("Vendor not found");
  }
  const store = await Store.find({ storeOwner: req.vendor.id });
  res.status(200).json(store);
});

